import Home from "./components/Home";
import Model from "./components/Model";
import Sidebar from "./components/Sidebar";
import { GlobalContext } from "./context";

function App() {
  return (
    <GlobalContext>
      <div className="main-container">
        <Home />
        <Sidebar />
        <Model />
      </div>
    </GlobalContext>
  );
}

export default App;
